export default function Dog({
  name,
  height,
  weight,
  years,
  image,
  temperament,
}) {
  return (
    <div>
      <div>{name}</div>
      <div>{height}</div>
      <div>{weight}</div>
      <div>{years}</div>
      <img alt={image} />
      <div>{temperament}</div>
    </div>
  );
}
